import React from 'react'
import JobCard from './components/JobCard'


export default class JobList extends React.Component {

  render(){
    console.log("JobList", this.props)

    return(
      <div> 
        {this.props.jobs.map(job => <JobCard job={job}/>)}
      </div>
    )

  }

}
